import React, { useContext } from "react";
import { Context } from "../index";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import { NavLink } from "react-router-dom";
import { REG_ROUTE, LOGIN_ROUTE, MAIN_ROUTE } from "../utils/consts";
import { Button } from "react-bootstrap";
import { observer } from "mobx-react-lite";
import Container from "react-bootstrap/Container";
import { useHistory } from "react-router-dom";
const NavBar = observer(() => {
  console.log("NavBar");
  const history = useHistory()
  return (
    <Navbar bg="dark" variant="dark">
      <div className="app-background">
        <div className="header1">
          <div className="menu-logo">
            <a id="a_logo" href="/">
              <img src="https://sun9-13.userapi.com/impg/KqHymWOrbJa5pXlnmTYgqj7i5W4tycBajKOkHg/8arhKJyk4eY.jpg?size=133x54&quality=95&sign=52f7f413b1f4705a4d0ad81feb34b911&type=album"></img>
            </a>
          </div>
          {/* Хедер */}
          <div className="menu-left" id="id-menu-left">
            <a href="/play" className="forHeader1">
              Играть
            </a>
            <a href="/square" className="forHeader1">
              Команда
            </a>
            <a href="/app" className="forHeader1">
              Приложение
            </a>
          </div>
          <div className="menu-right">
            <button id="button-reg" onClick={() => history.push(MAIN_ROUTE)}>
              Показать
            </button>
            <button id="button-reg" onClick={() => history.push(REG_ROUTE)}>
              Регистрация
            </button>
            <button id="button-log" onClick={() => history.push(LOGIN_ROUTE)}>
              Войти
            </button>
          </div>
        </div>
      </div>
    </Navbar>
  );
});

export default NavBar;
